import React, { Component } from 'react'
import logo from './../logo.svg';
import './../App.css';
export default class homscreens extends Component {
    render() {
        return (
            <div>
                <h1>Latitude</h1>
                <h1>Longitude</h1>
                <form>
                    <label>
                    <input type="text" name="latitude" />
                    </label>
                    <label>
                    <input type="text" name="longitude" />
                    </label>
                    <br />
                    <input type="submit" value="Submit" />
                </form>
            </div>
        )
    }
}
